import React from "react";
import styled from "styled-components";

const LoginUserInfo = () => {
    return (
        <Wrapper>
          <p className="title">사용하실 닉네임을 입력해주세요</p>
        </Wrapper>
    );
};

export default LoginUserInfo;

const Wrapper = styled.div`
.login-components{
  max-width: 375px;
  margin: 0 auto; 
  display: flex;
  flex-direction: column; 
  justify-content: center; 
  align-items: center; 
}
  .title {
    color: #212529;
    font-size: 24px;
    font-family: Pretendard Variable;
    font-weight: 700;
    line-height: 32px;
    word-wrap: break-word;
  }
`
